INSERT INTO `t_project` VALUES ('RzsRh8', '0', '快速开始', '{\"id\":\"IsrtRE\",\"title\":\"了解卷王\",\"description\":\"<a href=\\\"https://surveyking.cn/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"font-size: 18px;\\\">点击查看官方文档</a>\",\"type\":\"Survey\",\"attribute\":{\"suffix\":\"您已完成本次问卷，感谢您的帮助与支持\",\"submitButton\":\"提交\",\"globalRule\":[]},\"children\":[{\"id\":\"179c\",\"title\":\"<p><span style=\\\"color: rgb(230, 0, 0);\\\">注意，卷王问卷系统的逻辑和设置是分开的，</span><strong style=\\\"color: rgb(230, 0, 0);\\\">点击题目显示题目设置</strong><span style=\\\"color: rgb(230, 0, 0);\\\">，</span><strong style=\\\"color: rgb(230, 0, 0);\\\">点击选项显示选项设置</strong><span style=\\\"color: rgb(230, 0, 0);\\\">！</span></p><p><br></p><p><span style=\\\"font-size: 18px;\\\">常见问题：</span></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">1、 如何修改系统名称和开启用户注册</span></p><p>在<strong>系统管理-&gt;个人设置-&gt;系统设置</strong>里面可以修改当前系统名称和系统图标，开启用户注册，开启登录验证码</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">2、问题如何添加图片</span></p><p>图片直接复制粘贴即可，或者点击题目，高级设置，在弹窗里面上传图片，支持剪贴板复制粘贴图片。无论是问题、选项还是考试的答题解析都是支持富文本的（包含图片、视频、音频、数学公式等）</p><p><img src=\\\"data:image/png;base64,\\\" width=\\\"286\\\"></p><p><span style=\\\"font-size: 16px;\\\">3、如何开启投票</span></p><p>单选题和多选题的问题设置里面，打开<strong>显示投票结果</strong>开关即可</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">4、如何设置问卷关联</span></p><p>参考<a href=\\\"https://surveyking.cn/help/field-form/form-association\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">问卷关联设置</a>，可以在一个问卷里面引用其他问卷的答案</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">5、首页我的问卷里面如何才能显示问卷信息</span></p><p>打开系统设置，回收设置，添加<strong>系统用户白名单</strong></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">6、如何创建公开查询（</span><span style=\\\"font-size: 16px; color: rgb(0, 102, 204);\\\">类似易查分和金山快查</span><span style=\\\"font-size: 16px;\\\">）</span></p><p>打开系统设置，投放与分享，公开查询设置，新建查询页面</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">7、如何快速入门公式</span></p><p>请参考<a href=\\\"https://hc.jiandaoyun.com/doc/9032\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">简单云-公式规则文档</a> 和 卷王的<a href=\\\"https://surveyking.cn/help/logic/formula\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">公式文档</a>(使用方式和原理基本一样)，目前卷王支持显示逻辑、结束逻辑、跳转逻辑、计算逻辑、校验逻辑、答卷完自定义提示语逻辑、文本替换逻辑，理论上支持比问卷星强大的多的逻辑设置。</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">8、如何设置计算公式，比如根据身份证号计算年龄和性别</span></p><p>参考<a href=\\\"https://surveyking.cn/help/logic/calculate\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">计算逻辑文档</a></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">9、如何设置题目的显示隐藏</span></p><p>参考<a href=\\\"https://surveyking.cn/docs/guides/logic/show\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">显示逻辑文档</a></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">10、如果自定义答卷后的页面显示</span></p><p>打开系统设置，投放与分享，答题后自定义跳转页面</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">11、需要更多功能，提交一个 bug</span></p><p>如果您需要一个新的功能，或者在使用过程中发现了一个问题，可以通过这个链接 <a href=\\\"https://wj.surveyking.cn/s/start\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">https://wj.surveyking.cn/s/start</a> 来提交</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">12、系统商用免费吗？</span></p><p>无论公司还是个人，都可以免费使用，如果需要获取更强大的功能、更稳定的服务、二开定制等可以考虑购买我们的 Pro 版本，<a href=\\\"https://surveyking.cn\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">进入官网</a> ，人工咨询即可。</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">13、如何修改系统名称和 logo？</span></p><p>「系统管理&gt;个人设置&gt;系统设置」里面可以修改系统名称、logo、开启是否登录、设置备案号等操作</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">14、捐助作者</span></p><p><span style=\\\"font-size: 14px;\\\">坚持不易，如果对您有帮助，可以捐助作者或者在 </span><a href=\\\"https://gitee.com/surveyking/surveyking\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"font-size: 14px;\\\">https://gitee.com/surveyking/surveyking&nbsp;</a><span style=\\\"font-size: 14px;\\\">给一个 star，非常感谢 🙏。</span></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">15、免责声明</span></p><p><a href=\\\"https://surveyking.cn/help/disclaimer\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">点击查看</a></p>\",\"type\":\"Remark\",\"attribute\":{}}]}', '{\"status\":1,\"answerSetting\":{\"progressBar\":true,\"questionNumber\":true,\"autoSave\":false,\"whitelistType\":3,\"triggerType\":\"onBlur\"},\"submittedSetting\":{},\"examSetting\":{}}', 1, 'survey', 1000, 0, '2022-11-07 15:13:20', '1457995481966747649', '2024-08-14 20:01:01', '1457995481966747649');
INSERT INTO `t_project` VALUES ('g5GacM', '0', '考试功能演示', '{\"id\":\"g8YKtO\",\"title\":\"科目1考试\",\"description\":\"抽题可以有两种模式：固定题库抽题和随机抽题\",\"type\":\"Survey\",\"attribute\":{\"suffix\":\"您已完成本次考试。\",\"submitButton\":\"提交\",\"examScore\":100.0,\"globalRule\":[]},\"children\":[{\"id\":\"1821712519335702537\",\"title\":\"驾驶人在超车时， 前方车辆不减速 、不让道， 应怎样做？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"MPFf\",\"title\":\"a.加速继续超越\",\"attribute\":{}},{\"id\":\"5MLj\",\"title\":\"b.连续鸣喇叭加速超越\",\"attribute\":{}},{\"id\":\"3HNy\",\"title\":\"c.主动礼让， 确保行车安全\",\"attribute\":{}},{\"id\":\"kC4Q\",\"title\":\"d.挤靠“加塞”车辆， 逼其离开 答案： c\",\"attribute\":{\"examCorrectAnswer\":\"kC4Q\"}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702533\",\"title\":\"这个开关控制机动车哪个部位？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"s7MQ\",\"title\":\"a.风窗玻璃除雾器\",\"attribute\":{}},{\"id\":\"oRQr\",\"title\":\"b.风窗玻璃刮水器\",\"attribute\":{}},{\"id\":\"ObB8\",\"title\":\"c.危险报警闪光灯\",\"attribute\":{\"examCorrectAnswer\":\"ObB8\"}},{\"id\":\"PEtd\",\"title\":\"d.照明 、信号装置\",\"attribute\":{}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702534\",\"title\":\"机动车仪表板上（如图所示） 亮表示什么？ 单选题\",\"description\":\"<img src=\\\"data:image/png;base64,\\\" width=\\\"89\\\">\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"Himw\",\"title\":\"a.前照灯开启\",\"attribute\":{}},{\"id\":\"c36b\",\"title\":\"b.危险报警闪光灯开启\",\"attribute\":{\"examCorrectAnswer\":\"c36b\"}},{\"id\":\"rsjf\",\"title\":\"c.前后位置灯开启\",\"attribute\":{}},{\"id\":\"AGMU\",\"title\":\"d.前后雾灯开启\",\"attribute\":{}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702532\",\"title\":\"这个标志是何含义？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"p69g\",\"title\":\"a.双向交通\",\"attribute\":{\"examCorrectAnswer\":\"p69g\"}},{\"id\":\"MDNU\",\"title\":\"b.分离式道路\",\"attribute\":{}},{\"id\":\"RIQg\",\"title\":\"c.潮汐车道\",\"attribute\":{}},{\"id\":\"khJy\",\"title\":\"d.减速让行\",\"attribute\":{}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702531\",\"title\":\"有下列哪种违法行为的机动车驾驶人将被一次记 12 分？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"Vm0Q\",\"title\":\"a.驾驶故意污损号牌的机动车上道路行驶\",\"attribute\":{\"examCorrectAnswer\":\"Vm0Q\"}},{\"id\":\"CoxL\",\"title\":\"b.机动车驾驶证被暂扣期间驾驶机动车的\",\"attribute\":{}},{\"id\":\"Yg0e\",\"title\":\"c. 以隐瞒 、欺骗手段补领机动车驾驶证的\",\"attribute\":{}},{\"id\":\"DTD2\",\"title\":\"d.驾驶机动车不按照规定避让校车的\",\"attribute\":{}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702546\",\"title\":\"驾驶人的机动车驾驶证被依法扣留 、暂扣的情况下不得驾驶机动车。 判断题\",\"type\":\"Judge\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"dOZk\",\"title\":\"对\",\"attribute\":{}},{\"id\":\"dVdE\",\"title\":\"错\",\"attribute\":{\"examCorrectAnswer\":\"dVdE\"}}]},{\"id\":\"1821712519335702541\",\"title\":\"机动车仪表板上（如图所示） 亮， 表示驻车制动器操纵杆可能没松到底。 判断题\",\"description\":\"<img src=\\\"data:image/png;base64,\\\" width=\\\"71\\\">\",\"type\":\"Judge\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"9gN9\",\"title\":\"对\",\"attribute\":{}},{\"id\":\"RKFQ\",\"title\":\"错\",\"attribute\":{}}]},{\"id\":\"1821712519335702543\",\"title\":\"安装防抱死制动装置 （ABS） 的机动车制动时， 制动距离会大大缩短， 因此不必保持安 全车距。\",\"type\":\"Judge\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"r1jR\",\"title\":\"对\",\"attribute\":{}},{\"id\":\"GaRJ\",\"title\":\"错\",\"attribute\":{\"examCorrectAnswer\":\"GaRJ\"}}]},{\"id\":\"1821712519335702548\",\"title\":\"驾驶机动车遇到漫水桥时要察明水情确认安全后再低速通过。 判断题\",\"type\":\"Judge\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"a6CD\",\"title\":\"对\",\"attribute\":{}},{\"id\":\"O3mB\",\"title\":\"错\",\"attribute\":{\"examCorrectAnswer\":\"O3mB\"