INSERT INTO `t_project` VALUES ('qFFOFR', '0', '问卷功能演示', '{\"id\":\"qFFOFR\",\"title\":\"功能演示\",\"description\":\"<p>本文仅仅演示卷王问卷系统的部分功能，更多有趣又有用的功能可以<a href=\\\"https://surveyking.cn/help/quickstart\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">参考官网文档</a>。</p><p>在问卷设置、数据校验和逻辑配置等主要问卷场景中，卷王问卷系统的表现远远优于其他同类产品。</p>\",\"type\":\"Survey\",\"attribute\":{\"suffix\":\"您已完成本次问卷，感谢您的帮助与支持\",\"submitButton\":\"提交\",\"globalRule\":[]},\"children\":[{\"id\":\"1eb6\",\"title\":\"<span style=\\\"color: rgb(230, 0, 0);\\\">您</span><span style=\\\"color: rgb(255, 153, 0);\\\">更</span><span style=\\\"color: rgb(255, 255, 0);\\\">喜</span><span style=\\\"color: rgb(0, 138, 0);\\\">欢哪</span><span style=\\\"color: rgb(0, 102, 204);\\\">位</span><strong style=\\\"color: rgb(153, 51, 255);\\\">歌</strong>手？\",\"description\":\"投票题演示，所有的文本都是支持富文本输入的，可以上传图片、视频、公式等。\",\"type\":\"Radio\",\"attribute\":{\"required\":true,\"columns\":1,\"statEnabled\":true},\"children\":[{\"id\":\"vgrq\",\"title\":\"<img src=\\\"data:image/png;base64,\\\" width=\\\"90\\\">\",\"attribute\":{}},{\"id\":\"gb82\",\"title\":\"<img src=\\\"data:image/png;base64,\\\" width=\\\"86\\\">\",\"attribute\":{}},{\"id\":\"72kb\",\"title\":\"<img src=\\\"data:image/png;base64,\\\" width=\\\"82\\\">\",\"attribute\":{}}]},{\"id\":\"7rmu\",\"type\":\"SplitLine\",\"attribute\":{}},{\"id\":\"wfv9\",\"title\":\"您从事的行业是？\",\"description\":\"本题演示使用问卷字典实现二级级联(最多支持五级级联)\",\"type\":\"HorzBlank\",\"attribute\":{\"required\":true,\"content\":\"<p>一级分类<span class=\\\"ql-insert-blank\\\" data-id=\\\"o2p5\\\" contenteditable=\\\"false\\\">____________</span></p><p>二级分类<span class=\\\"ql-insert-blank\\\" data-id=\\\"o6bk\\\" contenteditable=\\\"false\\\">____________</span></p>\"},\"children\":[{\"id\":\"o2p5\",\"title\":\"填空1\",\"attribute\":{\"dataType\":\"selectDict\",\"cascaderLevel\":1,\"dictCode\":\"job\"}},{\"id\":\"o6bk\",\"title\":\"填空2\",\"attribute\":{\"dataType\":\"selectDict\",\"cascaderLevel\":2,\"dictCode\":\"job\"}}]},{\"id\":\"pu74\",\"type\":\"SplitLine\",\"attribute\":{}},{\"id\":\"ijqe\",\"title\":\"您的姓名\",\"type\":\"FillBlank\",\"attribute\":{\"required\":true},\"children\":[{\"id\":\"jq29\",\"attribute\":{}}]},{\"id\":\"hrzt\",\"title\":\"您的BMI信息\",\"description\":\"本题演示自动计算、数据校验，根据身高体重自动计算BMI值，并且可以通过答案引用配置，可以根据BMI 的计算结果动态的显示不同的提示信息。\",\"type\":\"MultipleBlank\",\"attribute\":{\"required\":true},\"children\":[{\"id\":\"vcad\",\"title\":\"身高\",\"attribute\":{\"dataType\":\"number\",\"scope\":\"[20,260]\"}},{\"id\":\"r4fw\",\"title\":\"体重\",\"attribute\":{\"dataType\":\"number\",\"scope\":\"[20,200]\"}},{\"id\":\"rkov\",\"title\":\"BMI值\",\"attribute\":{\"readOnly\":true,\"calculate\":\"#{hrzt.r4fw}/POWER(#{hrzt.vcad}/100, 2)\"}}]},{\"id\":\"sx1d\",\"title\":\"<p>您好，<span class=\\\"ql-text-refer\\\" data-formula=\\\"#{_ijqe}\\\" contenteditable=\\\"false\\\">您的姓名</span></p><p><span class=\\\"ql-text-refer\\\" data-formula=\\\"CONCATENATE(\'<p><strong style=\\\\&quot;color: rgb(0, 0, 0);\\\\&quot;>分类&amp;nbsp; &amp;nbsp; &amp;nbsp;BMI值范围</strong></p><p><strong style=\\\\&quot;color: rgb(128, 0, 128);\\\\&quot;>偏瘦：&amp;nbsp; &amp;lt;= 18.4&amp;nbsp;</strong></p><p><strong style=\\\\&quot;color: rgb(0, 128, 0);\\\\&quot;>正常：&amp;nbsp; 18.5 ~ 23.9</strong></p><p><strong style=\\\\&quot;color: rgb(255, 140, 0);\\\\&quot;>过重：&amp;nbsp; 24.0 ~ 27.9</strong></p><p><strong style=\\\\&quot;color: rgb(178, 34, 34);\\\\&quot;>肥胖：&amp;nbsp; &amp;nbsp;&amp;gt;=28.0</strong></p><p>您的BMI值为\',#{hrzt.rkov},\'，您的BMI值比对结果是\',SWITCH(true, #{hrzt.rkov}<=18.4, \'偏瘦\', #{hrzt.rkov}>28, \'肥胖\', #{hrzt.rkov}>=24,\'过重\',\'正常\'),\'</p>\')\\\" contenteditable=\\\"false\\\">答案引用</span></p>\",\"type\":\"Remark\",\"attribute\":{}},{\"id\":\"prr1\",\"type\":\"SplitLine\",\"attribute\":{}},{\"id\":\"dp1e\",\"title\":\"本次参加考试的学生有\",\"type\":\"MatrixAuto\",\"attribute\":{\"required\":true},\"children\":[{\"id\":\"i5vj\",\"title\":\"姓名\",\"attribute\":{\"width\":150,\"dataType\":\"text\"}},{\"id\":\"8rmo\",\"title\":\"性别\",\"attribute\":{\"width\":150,\"dataType\":\"select\"},\"dataSource\":[{\"label\":\"男\",\"value\":\"j3z6\"},{\"label\":\"女\",\"value\":\"3by1\"}]},{\"id\":\"yk2l\",\"title\":\"收费\",\"attribute\":{\"width\":150,\"dataType\":\"number\",\"scope\":\"(20,100)\"}}]},{\"id\":\"0zf5\",\"title\":\"合计收费\",\"description\":\"自动合并计算矩阵自增题的值\",\"type\":\"FillBlank\",\"attribute\":{\"required\":true},\"children\":[{\"id\":\"0u21\",\"attribute\":{\"calculate\":\"SUM(#{dp1e.yk2l})\"}}]},{\"id\":\"lmue\",\"type\":\"SplitLine\",\"attribute\":{}},{\"id\":\"fjnl\",\"title\":\"<p>卷王提供了各种各样的逻辑配置，最基本的显示隐藏逻辑可以通过左侧的逻辑可视化配置来实现。</p><p>除此之外，还可以通过公式配置来实现更多复杂的逻辑场景。</p>\",\"type\":\"Remark\",\"attribute\":{}},{\"id\":\"5ipz\",\"title\":\"请选择您感兴趣的技术领域（可多选）【多选题】\",\"type\":\"Checkbox\",\"attribute\":{\"required\":true},\"children\":[{\"id\":\"so2l\",\"title\":\"人工智能\",\"attribute\":{}},{\"id\":\"8pqv\",\"title\":\"大数据\",\"attribute\":{}},{\"id\":\"yhqr\",\"title\":\"区块链\",\"attribute\":{}},{\"id\":\"kibv\",\"title\":\"云计算\",\"attribute\":{}},{\"id\":\"x8a2\",\"title\":\"物联网\",\"attribute\":{}},{\"id\":\"kiv6\",\"title\":\"网络安全\",\"attribute\":{}},{\"id\":\"jwgm\",\"title\":\"边缘计算\",\"attribute\":{}}]},{\"id\":\"bidm\",\"title\":\"请详细说明您对以上选项的兴趣所在【填空题】\",\"description\":\"当上一题的选项超过3个才显示当前题\",\"type\":\"Textarea\",\"attribute\":{\"required\":true,\"visibleRule\":\"SUM(IF(#{5ipz.so2l},1,0),IF(#{5ipz.8pqv},1,0),IF(#{5ipz.yhqr},1,0),IF(#{5ipz.kibv},1,0),IF(#{5ipz.x8a2},1,0),IF(#{5ipz.kiv6},1,0),IF(#{5ipz.jwgm},1,0))>3\"},\"children\":[{\"id\":\"tonl\",\"attribute\":{\"calculate\":\"\"}}]}]}', '{\"status\":0,\"answerSetting\":{\"progressBar\":true,\"questionNumber\":true,\"autoSave\":true,\"triggerType\":\"onBlur\",\"copyEnabled\":true},\"submittedSetting\":{},\"examSetting\":{}}', 0, 'survey', 1002, 0, '2024-08-14 20:01:18', '1457995481966747649', '2024-08-14 20:02:13', '1457995481966747649');
